        {/* <DoctorLayout/>  */}
        {/* <PatientLayout/> */}
        {/* <AdminLayout /> */}
        {/* <Home2 />   */}
        {/* <Linker /> */}
        {/* <VitalsTable2/> */}
        {/* <DoctorLayout/> */}
        {/* <PatientLayout/> */}
        {/*//Note for route vtials/userid we need to pass the id to the componenet also */}
        <BrowserRouter>
          <Route path="/" component={Home2} />
          <Route path="/signin" exact component={SignIn} />
          <Route path="/signup" exact component={SignUp} />
          <Route path="/doctor" exact component={DoctorLayout} />
