          <Route path="/admin" exact component={AdminLayout} />
          <Route path="/vitals/:userid" exact component={VitalsTable2} />
          <Route path="/vitals" exact component={VitalsTable2} />
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
